import React from 'react';
import TableWidget from '../widgets/TableWidget'

function createEventdata(name, age, phone, email, company, registeredevents=1) {
    return { name, age, phone, email, company, registeredevents };
  }
  
  const rows = [
    createEventdata('Cupcake', 25, '123456789', 'example@gmail.com', 'spectrum Global',2),
    createEventdata('Donut', 30, '123456789', 'example@gmail.com', 'spectrum Global', 2),
    createEventdata('Eclair', 35, '123456789', 'example@gmail.com', 'spectrum Global',5),
    createEventdata('Frozen yoghurt', 29, '123456789', 'example@gmail.com', 'spectrum Global',3),
    createEventdata('Gingerbread', 35, '123456789', 'example@gmail.com', 'spectrum Global',4),
    createEventdata('Honeycomb', 40, '123456789', 'example@gmail.com', 'spectrum Global',5),
    createEventdata('Ice cream sandwich', 55, '123456789', 'example@gmail.com', 'spectrum Global',6),
    createEventdata('Jelly Bean', 4, '123456789', 'example@gmail.com','spectrum Global',5),
    createEventdata('KitKat', 42, '123456789', 'example@gmail.com', 'spectrum',5),
    createEventdata('Lollipop', 27, '123456789', 'example@gmail.com', 'spectrum Global',5),
    createEventdata('Marshmallow', 3,'123456789', 'example@gmail.com', 'spectrum', 'spectrum Global',5),
    createEventdata('Nougat', 28, '123456789', 'example@gmail.com', 'spectrum Global',5),
    createEventdata('Oreo', 29, '123456789', 'example@gmail.com', 'spectrum Global',5),
  ];

const columns = [
    { key_id: 'name', numeric: false, disablePadding: true, label: 'Name', sortFlag:true },
    { key_id: 'age',  numeric: true, disablePadding: false, label: 'Age', sortFlag:true },
    { key_id: 'phone', numeric: true, disablePadding: false, label: 'Phone', sortFlag:false },
    { key_id: 'email', numeric: false, disablePadding: false, label: 'Email', sortFlag:false },
    { key_id: 'company', numeric: false, disablePadding: false, label: 'Company', sortFlag:false },
    { key_id: 'registeredevents', numeric: true, disablePadding: false, label: 'Registered Events', sortFlag:false}
  ];

function Usertable(){
    const tableTitle="User List";
    return (
        <React.Fragment>            
            <TableWidget 
              rows={rows} 
              defaultSort='name'
              columns={columns}
              tableTitle={tableTitle}
            
            />
        </React.Fragment>
    );
}

export default Usertable;
